import './App.css';
import React, { useState } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Navbar from 'react-bootstrap/Navbar';


const NavBa = () => {

  return (
    <Navbar bg="dark" variant="dark" expand="lg">
    <Navbar.Brand href="#home">Live-survey</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <NavDropdown title="Ankety" id="Survey-menu">
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Vytvořit anketu</NavDropdown.Item>
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Veřejné ankety</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Smazat anketu</NavDropdown.Item>
        </NavDropdown>
        <Nav.Link href="https://github.com/EditaBozkova/LiveSurvey">Github</Nav.Link>
      </Nav>
    </Navbar.Collapse>
    <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
          <a href="https://github.com/EditaBozkova">@EditaBozkova </a>
          <a href="https://github.com/Pompino">@Pompino </a>
          </Navbar.Text>
        </Navbar.Collapse>
  </Navbar>
  );
};

const App = () => (
  <Container className="p-1">
    <NavBa></NavBa>
    <Jumbotron>
      <Container>
        <h1>Živé ankety</h1>
        <p>
        Vítejte na jedinečné webové aplikaci, která Vám pomůže vytvořit a následně sdílet živé ankety!
        </p>
        <ul>
          <li>gfgf</li>
          <li>fdfd</li>
          <li>gdf</li>
        </ul>
     </Container>
    </Jumbotron>
  </Container>
);

export default App;
